import React from 'react'
import Header from './Header/Header'

import styles from './Layout.module.scss'

const Layout = ({children , bgImage, height}) => {
  return (
    <div className={styles.wrapper} style={{height}}>
        <Header/>
        <div>
        {children}
        </div>
    </div>
  )
}

export default Layout
